css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 0.5rem 1.5rem;
  text-align: center;
  font-weight: 600;
  color: #aeb0bd;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #30323d;
  background-color: #3d404e;
}
.github-tab-icon {
  color: #6f717f;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #545665;
  border-radius: 4px;
  padding: 0 .25em;
  margin-left: 0.5rem;
}
.github-tab.react-tabs__tab--selected {
  color: #f9f9fb;
  box-shadow: 0 1px 0 #4b4e5f;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #d3d5e3;
}
